window.bookSummaryJSON = "<p><b>She’d willingly march into hell...just not with him.</b></p> <p>Fiercely loyal to her country, Nadine will do whatever it takes to destroy the ancient evil threatening her world - anything except allow a wild savage to put his mark on her.</p> <p>Plagued by survivor’s guilt, Magnus the Vast vows to do whatever it takes to bring home the friend he left behind. Claiming the beautiful hellcat who wants his head is a convenient bonus...one he won’t let her get out of.</p> <p>Bound together, Nadine and Magnus must rely on one another to complete their mission and save their people. Easier said than done for the woman-warrior who thinks her new ally a domineering brute, and the sly barbarian who is all too happy to play the part.</p> <p>They’ll walk into the pit of the earth, and they’ll do it together - or they may never walk out.</p>"; 
